import React from "react";
import { connect } from "react-redux";
import "./favorites.css";

const Favorites = props => {
  return (
    // <ul className="recentImages">
    //   {props.favorites.map(favImage => {
    //     return <li key="{favImage.favImage_id}">{favImage.favImage_name}</li>;
    //   })}
    // </ul>

    <div className="favoriteBox">
      <div className="favoriteImages">
        {props.favs.map(el => (
          <div {...el} key={el.id}>
            <image src={el.image} />
            <div class="imageTitle">Title</div>
            <div class="imageOwner">Owner</div>
            <div class="imageDate">Added Date</div>
            <div class="stats">Views Favs Comments</div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Favorites;
